import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Navigate to a category page to access sort controls
    await page.waitForSelector('div.category-card:has-text("Electronics")', { timeout: 5000 });
    await page.click('div.category-card:has-text("Electronics")');

    // Wait for sort controls to appear
    await page.waitForSelector('#sortSelect', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_category_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_category_page.png'));

    // Apply price sort filter (low to high)
    await page.selectOption('#sortSelect', 'price-low');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_sort_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_sort_applied.png'));

    // Wait for products to re-sort and verify the change
    await page.waitForTimeout(1000);

    // Extract product prices to verify sorting
    const prices = await page.$$eval('.product-price', priceElements => {
      return priceElements.map(el => {
        const text = el.textContent;
        const match = text.match(/\$\d+(\.\d{2})?/);
        return match ? parseFloat(match[0].replace('$', '')) : 0;
      });
    });

    // Verify prices are sorted in ascending order
    const isSorted = prices.every((price, i, arr) => i === 0 || price >= arr[i - 1]);

    return {
      success: true,
      action: "Applied price sort filter (low to high) on Electronics category",
      extractedData: {
        prices: prices,
        isSorted: isSorted,
        sortType: "price-low"
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price sort filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
